description:
Verenigde Staten / Duitsland
Drama / Thriller
104 minuten

goed

met Kate Hudson, Gena Rowlands en Peter Sarsgaard

Verpleegster Caroline (Kate Hudson) verzorgt een oude vrouw en haar zeer zieke man. Ze wonen in een oud herenhuis en ze houden er 
vreemde gewoonten op na. Wanneer Caroline een loper krijgt van de vrouw des huizes, komt ze er al snel achter dat 1 deur in het 
huis niet te openen is...
